import React from 'react';

const AssingmentBox = ({course}) => {
 if(!course){
  return
 }
 return (
  <div>
    {
     course.map(assignment => {
      return assignment.assignment_name
     })
    }
  </div>
 );
};

export default AssingmentBox;
